  axios.delete('http://localhost:5000/api/logout')
        .then(response=>{
          console.log('Hello')
        }) 
        .catch(err=>{
          console.log(err);
        })
}
  render() {
    return (
      <div>
      <button onSubmit={this.logout}>Logout</button>
      </div>
    )
  }
}
